func BenchmarkTestMismatch(b *testing.B) {
	s1 := []rune("aa")
	s2 := []rune("ab")

	for n := 0; n < b.N; n++ {
		Mismatch(s1, 0, len(s1)-1, s2, 0, len(s2)-1)
	}
}

